A Escola Pública de Trânsito (EPT), do Departamento Estadual de Trânsito de São Paulo (DETRAN-SP), foi criada pelo Decreto nº 58.396, de 18 de setembro de 2012. Seu objetivo principal é promover a educação para o trânsito e fornecer capacitação a motoristas, instrutores de trânsito e outros profissionais da área.

O DECRETO N° 69.053, DE 14 DE NOVEMBRO DE 2024 Aprova a Estrutura Organizacional e o Quadro Demonstrativo dos Cargos em Comissão e das Funções de Confiança do Departamento Estadual de Trânsito - DETRAN-SP.

O novo Regimento Interno do Departamento Estadual de Trânsito de São Paulo foi aprovado pela PORTARIA NORMATIVA DETRAN-SP Nº 37, DE 11 DE DEZEMBRO DE 2024, sendo de competência da Escola Pública de Trânsito coordenar, controlar, executar e avaliar as atividades referentes a:

I - educação de crianças, adolescentes, jovens e adultos, sobre legislação, sinalização e comportamento no trânsito, nos termos do inciso XVII do art. 22 da Lei federal nº 9.503, de 1997;

II - promoção da Política Nacional de Trânsito (PNT) e de cursos voltados para o exercício da cidadania, mobilidade e segurança no trânsito;

III - campanhas de conscientização para o trânsito seguro;

IV - ações de educação para condutores profissionais;

V - gestão da educação corporativa, formação, desenvolvimento contínuo e especialização dos empregados e servidores do DETRAN-SP.

Desde sua criação, a EPT tem se destacado na oferta de cursos tanto para o público interno quanto externo ao DETRAN-SP, na produção e distribuição de manuais instrutivos sobre habilitação, veículos e fiscalização, na promoção de palestras e encontros educacionais sobre temas relacionados ao trânsito e mobilidade, e na elaboração de projetos especiais.
